PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "sales" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "code" varchar(255) NULL, "customer" varchar(255) NULL, "from_time" datetime NULL, "to_time" datetime NULL, "gross_salon_sales" decimal NULL, "gross_retail_sales" decimal NULL, "total_gross_sales" decimal NULL, "total_salon_discount" decimal NULL, "retail_discount" decimal NULL, "service_net_sales" decimal NULL, "retail_net_sales" decimal NULL, "total_net_sales" decimal NULL, "cash" decimal NULL, "card" decimal NULL, "card_type" varchar(255) NULL, "em" decimal NULL, "prepaid" decimal NULL, "credit" decimal NULL, "tax" decimal NULL, "comment" varchar(255) NULL);
COMMIT;
